import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import Header from './components/Header';
import Footer from './components/Footer';

function App() {
  return (
    <div className="App">
      <Header></Header>
        <h1>Hello World</h1>
      <Footer className='mb-2'></Footer>
    </div>
  );
}

export default App;
